    "Union Slough National Wildlife Refuge: Wetland Management District narrative:
    Calendar year 1991",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-04-29T00:26:52.308428",nt"name": "union-slough-national-wildlife-refuge-wetland-management-district-narrative-calendar-year--95e7c",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Union
    Slough National Wildlife Refuge outlines Refuge accomplishments during the 1991
    calendar year. The report begins with a summary of the years highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses the management plan and compliance with environmental and cultural
    resource mandates. Refuge administration is outlined; information about personnel,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, croplands, grasslands, haying, fire management, and pest
    control. The wildlife section of the report discusses wildlife diversity, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and other resident
    wildlife. The public uses of the Refuge described in this report include hunting
    and trapping. The equipment and facilities section of the report provides information
    about rehabilitation. Cooperative programs and items of interest are provided at
    the end. Refuge brochures are attached. The management plan for Twelve Mile Wetland
    Complex Waterfowl Production Area is included.",nt"license_title": "License
